import React from 'react';
import { Link } from "react-router-dom";

export default function NavBar() {
    return (
        <nav>
                    <Link exact={"true"} to="/">Dashboard</Link>  
                    <Link exact={"true"} to="/contact">Contact</Link>  
                    <Link exact={"true"} to="/itemmanager">Item Manager</Link> 
                    <Link exact={"true"} to="/viewitemdetail">View Item Detail</Link>
        </nav>
    );
}
